		Card verdash = new Card(77, "Verdash", "Land that Verdash has run across becomes extremely fertile, with thick vegetation growing there soon after. It will not run anywhere that herbicide has been used.", "grass", "humanoid", 107, 90, 1200, 8, "https://static.wikia.nocookie.net/palworld/images/4/43/Verdash_menu.png/");
		Card vaelet = new Card(78, "Vaelet", "The castle was filled with the king's favorite flowers. A great battle ensued, and flames approached the castle. Amidst the chaos, the spirit of a flower appeared. - From the fairy tale, The King's Flower.", "grass", "humanoid", 100, 100, 960, 8, "https://static.wikia.nocookie.net/palworld/images/2/24/Vaelet_menu.png/");
		Card sibelyx = new Card(79, "Sibelyx", "A Pal that likes the rain,and will often bask in rain showers until the weather clears up. On rainy days, Foxparks can often be found taking shelter beneath it.", "ice", "humanoid", 90, 110, 4900, 7, "https://static.wikia.nocookie.net/palworld/images/6/66/Sibelyx_menu.png/");
		Card elphidran = new Card(80, "Elphidran", "It possesses a demeanor as pure as its appearance suggests. Perhaps because of this, it is sometimes unable to discern good from evil, often allowing wrongdoers to take advantage of it.", "dragon", "humanoid", 80, 110, 4230, 7, "https://static.wikia.nocookie.net/palworld/images/a/a6/Elphidran_menu.png/");
		Card kelpsea = new Card(81, "Kelpsea", "Its personality changes depending on the quality of the water it was born into. Kelpsea born into polluted waters are generally ill-tempered and quickly become delinquents.", "water", "dragon", 85, 70, 260, 1, "https://static.wikia.nocookie.net/palworld/images/1/1b/Kelpsea_menu.png/");
		Card azurobe = new Card(82, "Azurobe", "This Pal's white ribbon turns black if doused with impure water. Given its usefulness in detecting poison, this Pal was once overhunted. This past has left them bitter towards humanity.", "water", "fish", 85, 110, 4600, 7, "https://static.wikia.nocookie.net/palworld/images/a/a0/Azurobe_menu.png/");
		Card cryolinx = new Card(83, "Cryolinx", "It can easily climb steep mountains with its hard claws. However, its short legs make it difficult to descend, often leaving it stranded in high places.", "ice", "humanoid", 120, 100, 7440, 7, "https://static.wikia.nocookie.net/palworld/images/9/9d/Cryolinx_menu.png/");
		Card blazehowl = new Card(84, "Blazehowl", "While it prefers raw meat, it always ends up eating well-done meat. This is due to its blistering claws, which it uses as its weaponâ€”it simply doesn't realize its prey gets burned to a crisp.", "fire", "fourlegged", 105, 105, 3040, 7, "https://static.wikia.nocookie.net/palworld/images/3/33/Blazehowl_menu.png/");
		Card relaxaurus = new Card(85, "Relaxaurus", "Contrary to its blasÃ© appearance, it's quite ferocious. It perceives everything in its sight as prey and will stop at nothing to devour it.", "dragon", "monster", 105, 110, 9240, 8, "https://static.wikia.nocookie.net/palworld/images/0/01/Relaxaurus_menu.png/");
		Card broncherry = new Card(86, "Broncherry", "Its scent drastically changes before and after pairing. It exudes a pleasing aroma after finding a partner, which is called the \"fragrance of first love.\"", "grass", "fourlegged", 85, 120, 1920, 7, "https://static.wikia.nocookie.net/palworld/images/b/bd/Broncherry_menu.png/");
		Card petallia = new Card(87, "Petallia", "A pal that transforms into a massive plant when at the end of its life. Once every ten years, a beautiful flower blooms and a new Petallia is born.", "grass", "humanoid", 97, 100, 2590, 8, "https://static.wikia.nocookie.net/palworld/images/2/28/Petallia_menu.png/");
		Card reptyro = new Card(88, "Reptyro", "Magma-like blood runs throughout its body. If a large amount of water is thrown on it, this water rapidly heats, causing an immense vapor explosion.", "fire", "fourlegged", 102, 110, 5940, 6, "https://static.wikia.nocookie.net/palworld/images/d/d0/Reptyro_menu.png/");
		Card kingpaca = new Card(89, "Kingpaca", "Melpaca serve this Pal. Contests between Kingpaca offer up their vassals as a wager. Those seen alone are losers of such contests.", "neutral", "fourlegged", 92, 120, 4800, 8, "https://static.wikia.nocookie.net/palworld/images/9/9d/Kingpaca_menu.png/");
		Card mammorest = new Card(90, "Mammorest", "The vegetation on its back varies between individuals. There is a long history of appreciating this veritable garden of a Pal, and there are even Mammorest pruning specialists.", "grass", "fourlegged", 92, 150, 8450, 8, "https://static.wikia.nocookie.net/palworld/images/5/5e/Mammorest_menu.png/");
		Card wumpo = new Card(91, "Wumpo", "Researchers once tried to shave off its hair to reveal its true form. In the end, only hair was left, as if that was all there was to begin with.", "ice", "humanoid", 90, 140, 4900, 7, "https://static.wikia.nocookie.net/palworld/images/0/0e/Wumpo_menu.png/");
		Card warsect = new Card(92, "Warsect", "The ultra-hard armor surrounding its body is extremely strong and heat resistant. Even a napalm blast would hardly leave a scratch.", "grass", "humanoid", 100, 120, 5830, 8, "https://static.wikia.nocookie.net/palworld/images/a/a7/Warsect_menu.png/");
		Card fenglope = new Card(93, "Fenglope", "In ancient times, it was a familiar subject for painting because of its beautiful and majestic appearance. Fenglope is an endangered species, the Fenglope whose beautiful fur and horns are much sought after by poachers!", "neutral", "fourlegged", 110, 110, 1250, 3, "https://static.wikia.nocookie.net/palworld/images/6/68/Fenglope_menu.png/");
		Card felbat = new Card(94, "Felbat", "Attacking from the shadows, this Pal traps its prey within its cloak-like wings. It's probably best not to know what happens within them, or why the inside of its wings are stained red.", "dark", "humanoid", 102, 100, 1100, 6, "https://static.wikia.nocookie.net/palworld/images/7/7d/Felbat_menu.png/");
		Card quivern = new Card(95, "Quivern", "Sleeping while cuddling a Quivern is said to be a heavenly experience, but there are some who have been crushed and sent to heaven by ones that toss and turn in their sleep.", "dragon", "dragon", 100, 105, 5830, 7, "https://static.wikia.nocookie.net/palworld/images/d/d9/Quivern_menu.png/");
		Card blazamut = new Card(96, "Blazamut", "Legends say it was born during a volcanic eruption. A strange group even claims that this continent is laid upon the back of a giant Blazamut.", "fire", "fourlegged", 137, 100, 9520, 9, "https://static.wikia.nocookie.net/palworld/images/e/ee/Blazamut_menu.png/");
		Card helzephyr = new Card(97, "Helzephyr", "It calls forth lightning from the depths of hell. One who dies from Helzephyr's inferno is sure to be sent to the underworld.", "dark", "bird", 112, 100, 6840, 7, "https://static.wikia.nocookie.net/palworld/images/3/3c/Helzephyr_menu.png/");
		Card astegon = new Card(98, "Astegon", "A savage beast born of the abyss. Thou shall not stand before the beast. Thou shall not heed the beast.", "dragon", "monster", 112, 100, 7200, 9, "https://static.wikia.nocookie.net/palworld/images/d/d4/Astegon_menu.png/");
		Card menasting = new Card(99, "Menasting", "Being made of pure energy, its insides are completely hollow. This Pal crams still-living prey into its hollow body, where it absorbs them. Hellish screams of pain can often be heard coming from inside this Pal.", "dark", "other", 100, 100, 6050, 9, "https://static.wikia.nocookie.net/palworld/images/5/57/Menasting_menu.png/");
		Card anubis = new Card(100, "Anubis", "Once seen as a symbol of nobility, and an idol for those who shunned wealth and power. Yet over time, this Pal became a token of death.", "ground", "humanoid", 130, 120, 3960, 10, "https://static.wikia.nocookie.net/palworld/images/2/21/Anubis_menu.png/");
		Card jormuntide = new Card(101, "Jormuntide", "Legends says the Jormuntide was once a wise man, who after being wrongly convicted and cast into a whirlpool, returned as this Pal to destroy those who wronged him.", "dragon", "fish", 135, 130, 8320, 8, "https://static.wikia.nocookie.net/palworld/images/8/8e/Jormuntide_menu.png/");
		Card suzaku = new Card(102, "Suzaku", "It was once believed to usher in the dry season. Whenever there was a drought in the previous year, people would relentlessly seek to cull it's numbers, hoping to bring a plentiful harvest in the next year.", "fire", "bird", 102, 120, 8840, 8, "https://static.wikia.nocookie.net/palworld/images/b/b4/Suzaku_menu.png/");
		Card grizzbolt = new Card(103, "Grizzbolt", "With a friendly smile and a hardy physique, it is docile towards one it recognizes as a partner. For reasons unexplained, its personality undergoes a drastic change when wielding a minigun.", "electric", "humanoid", 110, 105, 6720, 8, "https://static.wikia.nocookie.net/palworld/images/1/13/Grizzbolt_menu.png/");
		Card lyleen = new Card(104, "Lyleen", "A docile Pal full of love. It watches over small Pals who have lost their parents. It uses a full-power Solar Blast to discipline naughty Pals.", "grass", "humanoid", 105, 110, 6160, 9, "https://static.wikia.nocookie.net/palworld/images/5/5e/Lyleen_menu.png/");
		Card faleris = new Card(105, "Faleris", "When it finds its prey it unleashes a whirlwind of flames, burning the entire area to ash. Faleris breath is known for its pleasing scent.", "fire", "bird", 102, 100, 5720, 9, "https://static.wikia.nocookie.net/palworld/images/9/99/Faleris_menu.png/");
		Card orserk = new Card(106, "Orserk", "It sends electricity into its foes' wounds, roasting them from the inside out. Fights between Orserk end in the blink of an eye.", "dragon", "humanoid", 115, 100, 7320, 9, "https://static.wikia.nocookie.net/palworld/images/6/6e/Orserk_menu.png/");
		Card shadowbeak = new Card(107, "Shadowbeak", "Forbidden existence born of madness. As he lost his genetic relationship with the other Pals, he may no longer be considered one of them.", "dark", "fourlegged", 125, 120, 8060, 10, "https://static.wikia.nocookie.net/palworld/images/0/0c/Shadowbeak_menu.png/");
		Card paladius = new Card(108, "Paladius", "In the past, he and Necromus were a single species. They say that they are an existence that has freed themselves from all negative feelings, but the depths of their eyes harbor traces of resentment.", "neutral", "fourlegged", 115, 130, 7810, 20, "https://static.wikia.nocookie.net/palworld/images/0/09/Paladius_menu.png/");
		Card necromus = new Card(109, "Necromus", "Once he and Paladius were a single species. They say it is the manifestation of negative feelings, but the depths of their eyes contain traces of compassion.", "dark", "fourlegged", 122, 130, 7930, 20, "https://static.wikia.nocookie.net/palworld/images/1/13/Necromus_menu.png/");
		Card frostallion = new Card(110, "Frostallion", "Guardian deity of Palpagos Island, known as the Winter Caller. In the past, when a calamity struck the land, it soared into the sky and sealed away the threat by casting the island into an eternal winter.", "ice", "fourlegged", 120, 140, 7440, 20, "https://static.wikia.nocookie.net/palworld/images/0/00/Frostallion_menu.png/");
		Card jetragon = new Card(111, "Jetragon", "Looks over the island of Palpagos from the ends of the sky. When the calamity awakens again, splitting the earth and setting the heavens on fire, he will destroy it with a glare of complete obliteration.", "dragon", "dragon", 120, 110, 7680, 20, "https://static.wikia.nocookie.net/palworld/images/e/e5/Jetragon_menu.png/");
		Card jolthog_cryst = new Card(112, "Jolthog Cryst", "It releases cold air stored in its body when under attack. The frigid blast it radiates is cold enough to freeze the surrounding air and easily pierces through any attacker's body.", "ice", "fourlegged", 72, 70, 70, 2, "https://static.wikia.nocookie.net/palworld/images/7/72/Jolthog_Cryst_menu.png");
		Card mau_cryst = new Card(113, "Mau Cryst", "Its crystalline tail is beautiful, but shatters when this Pal dies. Some believe it is good luck to raise one, so Mau Cryst in captivity are treated with great care.", "ice", "fourlegged", 67, 70, 10, 2, "https://static.wikia.nocookie.net/palworld/images/7/7a/Mau_Cryst_menu.png");
		Card gobfin_ignis = new Card(114, "Gobfin Ignis", "Once upon a time, it was a giant and powerful aquatic Pal. However, with the dwindling availability of food, it ventured onto land. As a consequence of burning many calories to walk, it astonishingly awakened its power to control fire!", "fire", "humanoid", 90, 90, 800, 3, "https://static.wikia.nocookie.net/palworld/images/9/9c/Gobfin_Ignis_menu.png");
		Card hangyu_cryst = new Card(115, "Hangyu Cryst", "Its gigantic arms can tear through blocks of ice. There were times when great sinners were tied in the town square and had their hair torn out by as a brutal form of public humiliation.", "ice", "other", 75, 80, 20, 2, "https://static.wikia.nocookie.net/palworld/images/4/49/Hangyu_Cryst_menu.png");
		Card mossanda_lux = new Card(116, "Mossanda Lux", "A Pal whose power is truly shocking. By altering the electrical currents in its body, this Pal's been able to overload its own strength. When it comes to sheer power, this Pal may be top of the list.", "electric", "humanoid", 100, 100, 5610, 7, "https://static.wikia.nocookie.net/palworld/images/0/05/Mossanda_Lux_menu.png");
		Card eikthyrdeer_terra = new Card(117, "Eikthyrdeer Terra", "The individual with the hardest horns becomes the leader. Once the horns are lost, so too is the leadership status. It leaves the herd admist farewell glances and quietly returns to the earth.", "ground", "fourlegged", 75, 95, 1680, 6, "https://static.wikia.nocookie.net/palworld/images/3/32/Eikthyrdeer_Terra_menu.png");
		Card incineram_noct = new Card(118, "Incineram Noct", "It specifically targets baby pals, taking them back to its territory. One can only imagine the profound despair of the parent Pal, whose child has been taken away.", "dark", "humanoid", 127, 95, 3870, 5, "https://static.wikia.nocookie.net/palworld/images/5/5b/Incineram_Noct_menu.png");
		Card leezpunk_ignis = new Card(119, "Leezpunk Ignis", "A Pal that has an unusual obsession with their standing posture. Always in search of the hottest pose, this Pal's owner is constantly presented with fervent stances.", "fire", "humanoid", 85, 80, 640, 3, "https://static.wikia.nocookie.net/palworld/images/e/ea/Leezpunk_Ignis_menu.png");
		Card robinquill_terra = new Card(120, "Robinquill Terra", "A Pal that lives a hunting life in rocky areas and is very close to humans. When bones are found in ruins, there are always human bones found nearby as well.", "grass", "humanoid", 102, 90, 1150, 6, "https://static.wikia.nocookie.net/palworld/images/4/45/Robinquill_Terra_menu.png");
