		Card dinossom_lux = new Card(122, "Dinossom Lux", "Though struck by lightning, it lives on. The phrase \"struck by a Dinossom Lux's bolt\" has come to mean narrowly escaping death.", "electric", "humanoid", 90, 110, 2380, 7, "https://static.wikia.nocookie.net/palworld/images/c/c7/Dinossom_Lux_menu.png");
		Card surfent_terra = new Card(123, "Surfent Terra", "Its aerodynamic form is well suited to life on the sand. Poachers often catch them and use them in place of surfboards", "ground", "fish", 80, 90, 4140, 5, "https://static.wikia.nocookie.net/palworld/images/f/ff/Surfent_Terra_menu.png");
		Card vanwyrm_cryst = new Card(124, "Vanwyrm Cryst", "The Melodies of a flute made from the exoskeleton of a Vanwyrm Cryst are said to cross whole mountain ranges. In ages past, such flutes were used to signal victory in a battle.", "ice", "bird", 110, 90, 3610, 5, "https://static.wikia.nocookie.net/palworld/images/1/19/Vanwyrm_Cryst_menu.png");
