		Card reptyro_cryst = new Card(130, "Reptyro Cryst", "Ice cold blood runs throughout its body. If heated rapidly, its blood evaporates, causing an immense vapor explosion.", "ice", "fourlegged", 102, 110, 6380, 7, "https://static.wikia.nocookie.net/palworld/images/0/09/Reptyro_Cryst_menu.png");
		Card kingpaca_cryst = new Card(131, "Kingpaca Cryst", "With a heart of ice, this Pal is terrible at expressing its emotions. A solitary individual is pitiable, seen as too clumsy in the eyes of Melpaca.", "ice", "fourlegged", 92, 120, 5100, 9, "https://static.wikia.nocookie.net/palworld/images/4/49/Kingpaca_Cryst_menu.png");
		Card mammorest_cryst = new Card(132, "Mammorest Cryst", "The vegetation on its back varies from individual to individual. There was a time when seeds of presumed extinct plants were found still frozen on the back of a Mammorest Cryst.", "ice", "fourlegged", 92, 150, 8580, 9, "https://static.wikia.nocookie.net/palworld/images/d/db/Mammorest_Cryst_menu.png");
